export const CategoryExercise = () => {
  return (
    <form>
      <label>
        Pick your favorite category:
        <select>
          <option value="*">Todos</option>
          <option value="espalda">Espalda</option>
          <option value="pecho">Pecho</option>
        </select>
      </label>
    </form>
  );
};
